import React from "react";
import "./Main_Top.css";

function Main_Top() {
  return (
    <div
      className="main-top"
      style={{
        backgroundImage: "url('/about-banner.png')",
        backgroundSize: 'cover',
        backgroundPosition: 'center ',
        backgroundRepeat: 'no-repeat',
        height: '100vh', // 화면 전체 높이
        width: '100%',
      }}
    >
		</div>
  );
}

export default Main_Top;
